public class WildCardMatching {
    public static boolean isMatch(String s, String p) {
        // these are strange case, edge case.
        int pl = 0;
        for (int i = 0; i < p.length(); i++) {
            if (p.charAt(i) != '*') {
                pl++;
            }
        }
        if (pl > s.length()) {
            return false;
        }
        if (s.length() == 0 && pl == 0) {
            return true;
        }
        // main function
        boolean[][] store = new boolean[2][s.length() + 1];
        store[0][0] = true;
        store[1][0] = false;
        for (int ps = 1; ps <= p.length(); ps++) {
            // remember to check the first one. make "*" can match ""
            if (p.charAt(ps - 1) == '*') {
                store[1][0] = store[0][0];
            } else {
                store[1][0] = false;
            }
            for (int ss = 1; ss <= s.length(); ss++) {
                if (p.charAt(ps - 1) == '?'
                        || p.charAt(ps - 1) == s.charAt(ss - 1)) {
                    store[1][ss] = store[0][ss - 1];
                } else if (p.charAt(ps - 1) != '*') {
                    store[1][ss] = false;
                } else {
                    store[1][ss] = store[0][ss - 1] || store[1][ss - 1]
                            || store[0][ss];
                }
            }
            for (int i = 0; i <= s.length(); i++) {
                store[0][i] = store[1][i];
            }
        }
        return store[1][s.length()];
    }

    public static boolean isMatchM(String s, String p) {
        if (s == null || p == null) return false;
        if (p.length() == 0 && s.length() > 0) return false;
        int pl = 0;
        for (int i = 0; i < p.length(); i++) {
            if (p.charAt(i) != '*') {
                pl++;
            }
        }
        if (pl > s.length()) {
            return false;
        }

        boolean[] prev_seq = new boolean[s.length() + 1];
        boolean[] new_seq = new boolean[s.length() + 1];

        prev_seq[0] = true;
        for (int i = 1; i <= p.length(); i++) {
            if (p.charAt(i - 1) == '*') {
                boolean jtseen = false;
                for (int j = 0; j <= s.length(); j++) {
                    if (prev_seq[j] || jtseen) {
                        new_seq[j] = true;
                        jtseen = true;
                    }
                }
            } else if (p.charAt(i - 1) == '?') {
                for (int j = 0; j < s.length(); j++) {
                    if (prev_seq[j]) {
                        new_seq[j + 1] = true;
                    }
                }
            } else {
                for (int j = 0; j < s.length(); j++) {
                    if (prev_seq[j] && p.charAt(i - 1) == s.charAt(j)) {
                        new_seq[j + 1] = true;
                    }
                }
            }
            prev_seq = new_seq;
            new_seq = new boolean[s.length() + 1];
            boolean cont = false;
            for (int k = 0; k <= s.length(); k++) {
                if (prev_seq[k]) {cont = true; break;}
            }
            if (!cont) return false;
//            for (int j = 0; j <= s.length(); j++) {
//                System.out.print(prev_seq[j] + " ");
//            }
//            System.out.println();

        }
        return prev_seq[s.length()];
    }

    public static void main(String[] args) {
        String s = "ab";
        String p = "?*";
        String s1 = "";
        String p1 = "**";
//        s1 = "a";
//        p1 = "aa";
        long t1 = System.currentTimeMillis();
        System.out.println(isMatch(s1, p1));
        long t2 = System.currentTimeMillis();
        System.out.println("time = " + (t2 - t1));
        t1 = System.currentTimeMillis();
        System.out.println(isMatchM(s1, p1));
        t2 = System.currentTimeMillis();
        System.out.println("time = " + (t2 - t1));

    }
}
